import { getOrder } from '../api/Products';
import { Link } from 'react-router-dom';

export default function Kitchen() {

  const [orders, setOrders] = useState([]);

  useEffect(() => {
    getOrder()
    .then((res) => {
      console.log(res.data)
      setOrders(res.data)
    })
    .catch()
  }, [])

  return (
    <div className="container">
      <h1>PÃ¡gina de cocina</h1>
      <p>
        <Link to="/">Sign Out</Link>
      </p>
      {orders.map((orders)=>(
        <div key={orders.id}>
          <ul>
            <li>{orders.client}</li>
            <li>{orders.status}</li>
            <li>{orders.products.product.name}</li>
            <li>{orders.products.product.price}</li>
            <li>{orders.products.qty}</li>
            <li>{orders.products.product.qty}</li>
          </ul>

        </div>
      ))}
    </div>
  );
}
